import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Page from './page'; // This is your main DSA Concepts page
import SortingAlgorithmsPage from './pages/SortingAlgorithmsPage'; // This is the new sorting page

function App() {
  return (
    <Routes>
      <Route path="/" element={<Page />} />
      <Route path="/sorting" element={<SortingAlgorithmsPage />} />
      {/* Add routes for other categories/algorithms here as needed */}
    </Routes>
  );
}

export default App;
